let data,romPlay;
window.addEventListener("load",async ()=>{
    const options = {
        method: 'GET',
        headers: {
            'X-RapidAPI-Key': 'd23387d0c7mshfac0ad57eb3617dp18f03ajsn1f371fe043b4',
            'X-RapidAPI-Host': 'shazam.p.rapidapi.com'
        }
    };
    
   await fetch('https://shazam.p.rapidapi.com/search?term=Romantic&locale=en-US&offset=0&limit=5', options)
        .then(response => response.json())
        .then(response =>{
            data = response;
        })
        .catch(err => console.error(err));

        console.log(data.tracks.hits[0]);

         romPlay = [
            {
                img : data.tracks.hits[0],
                title: data.tracks,
                artist : data.tracks,
                src: data.tracks
            }
        ]
});

export default romPlay;
